INSERT INTO `orders` (`id`, `rowid`, `serial`, `user_id`, `status`, `type`, `schedule_at`, `table_serial`, `pay_type`, `receive_name`, `receive_phone`, `receive_address`, `paided`, `remark`, `total`, `paid_serial`, `paid_remark`, `created_at`, `updated_at`) VALUES
(1, 1, 'A-9784353027273', 9, 'ALD', 'A', '2021-07-07 08:03:08', 'E16', 'P01', 'Name:昝安', '(02)462-9626', '322-49 雲林縣莿桐鄉草湖村仁愛街一段475號10樓', 1, NULL, 70671, '9795931409060', NULL, '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(2, 2, 'B-9793729901031', 8, 'ALD', 'B', '2021-06-30 08:03:08', 'A21', 'P01', 'Name:王惠', '(037)561-750', '532-34 新竹縣新埔鎮南村街766巷930弄961號', 1, NULL, 7187, '9792967846302', NULL, '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(3, 3, 'C-9783968487908', 7, 'TBC', 'C', '2021-07-01 08:03:08', 'F5', NULL, 'Name:伏偉', '0903386682', '798 臺東縣卑南鄉內江路二段462巷234號', 0, NULL, 62900, '9783458039617', '秀才娘子的東西的時候，已經恍然大得多了，雖不知怎麼樣？」 七斤嫂看著他的態度也很是「非其所以我的路。我希望。 “我說：他們家族的同志了，所以使用的小寡婦！」「怎樣，只要地位來。 兩岸的豆麥蘊藻之香的。', '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(4, 4, 'B-9790247479912', 8, 'CLD', 'B', '2021-07-05 08:03:08', '11', NULL, 'Name:容偉', '(05)0043542', '210-87 新竹縣竹東鎮環美街207巷663號', 0, NULL, 38401, '9794535000024', '裏，要他幫忙的問道：「無是非常快，一定要知道是小船，大聲說。 可惜這姓是不常穿的雖然沒有和別處不知道天下有這回又完了。 「我想笑嘻嘻的招呼，搬家到我的蝦嚇跑了六斤的光照著伸長脖子聽得他的老屋難免出弊。', '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(5, 5, 'B-9795220713564', 2, 'CLD', 'B', '2021-06-30 08:03:08', '10', NULL, 'Name:郝彥豪', '(02)7995-3793', '583 高雄市六龜區廣安二路904號', 0, '平日安排停當的待遇了。 時候，阿Q正沒好氣，自己的家裏去了。 但對面走一面想：他是否同宗，也是錯的。 吳媽楞了一下，從沒有來叫他做事小心的不是道士一般的前程，這也並不教，但現在槐樹上縊死過一個保，半。', 3822, '9793923998332', '慨激昂的意思之間頗氣憤模樣的趁熱吃下藥，和秀才說。」 「沒有這一件極薄的棉紗，也不要到他家裏，又即縮回去了，然而不能上牆，將他第二天倒也沒有了學樣的一坐墳前，朝笏一般的聲音。 第二日，幾乎怕敢想到趙。', '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(6, 6, 'B-9780340495810', 1, 'TBP', 'B', '2021-06-30 08:03:08', '19', 'P04', 'Name:石俊宗', '(076)222-988', '314-98 新竹縣竹東鎮久安二街二段553巷510弄591號95樓', 1, '寒，回來，方太太跟著他的女人，怕他看那些招人頭痛的教員聯合索薪大會裏的十二歲的少奶奶……留幾條麽？況且黑貓，常在那裏呢？」十幾場，事後卻連「喂，領來的呢。」 華大媽已在夜裏忽被抓出來了。 即此一端是。', 69655, '9786720279957', NULL, '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(7, 7, 'A-9780996836784', 1, 'TBC', 'A', '2021-07-01 08:03:08', 'D3', NULL, 'Name:閆承', '+886-987-329-597', '901 雲林縣西螺鎮斗六五街268號', 0, NULL, 15500, '9796373414278', NULL, '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(8, 8, 'B-9787163256895', 10, 'TBP', 'B', '2021-07-03 08:03:08', '3', NULL, 'Name:宿翰思', '(02)49646493', '784 嘉義市西區明仁一街六段160巷606號65樓', 0, NULL, 7593, '9781240512423', NULL, '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(9, 9, 'C-9782710600022', 8, 'ALC', 'C', '2021-07-02 08:03:08', 'C16', NULL, 'Name:琴華樺', '(02)7929-0611', '983-42 新竹縣峨眉鄉冷水路四段176巷81弄738號', 0, '要錢，都微笑著擠著走去，雖然比較的多是水世界真不成東西怎了？」「他喘氣平靜下來的清香，夾雜在水果店裡確乎抵不住立起身，就有兩家：一次是“咸與維新的衣兜裏落下一個聲音，有嚷的。 他站起來。 老拱手裏擎。', 40436, '9784586130641', '第一要算是生平所知道，「你能叫得他已經公同賣給別姓了，猹。月亮的影。 又過了九日，——一百八十塊錢，交給巡警走近我說，那時仿佛是想走異路，幾個兵，匪，官僚有什麼。」掌櫃的等待過什麼，而且知道我竟與閏。', '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(10, 10, 'B-9789552506086', 10, 'TBC', 'B', '2021-07-01 08:03:08', 'D10', 'P01', 'Name:索承信', '(02)9628-6103', '111-81 臺北市文山區朝奉路四段105巷648弄331號', 1, '船到了自己，也暫時開不得。」 他在我十一點沒有什麼地方還是忘了什麼地方。他自從慶祝了五條件： \"哈！”秀才和洋鬼子尚且不但沒有提起他的母親高興，他不知那裏嚷什麼地方，閨女生了麽？沒有「自知之明」的了。', 97458, '9781377331232', '他就領了錢，但為了滿幅補釘的飯碗，兩個字。 這樣無限量的卑屈……」 「左彎右彎……\" 我有意無意的或無意中，嗚嗚的唱。“得，鏘令鏘，鏘！悔不該，酒要菜，一面說，“請便罷！他，便要受餓，又有了，你闊了。', '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(11, 11, 'C-9793073642857', 2, 'CLD', 'C', '2021-07-05 08:03:08', '8', 'P01', 'Name:尚柏冠', '(02)78163838', '218-50 臺南市柳營區清潭街581巷875弄372號', 1, NULL, 65276, '9780108753237', NULL, '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
(12, 12, 'B-9795164006821', 10, 'CLD', 'B', '2021-07-05 08:03:08', '16', NULL, 'Name:公西嘉', '+886-912-053-118', '312 金門縣烏坵鄉柯林新街371巷522號', 0, '敗時候回來了一刻，便向他通黃的光線了。他躺了好一會，一見便知道他，知道是要到他，一直散到老主顧，雖然也可以走了。他所有的，原來他也仍然合上蓋一層布，阿Q回來，簡直是造反或者因為缺少潤筆的緣故，萬一政。', 66501, '9797165453536', '個錢呢！？ 很白很亮的影像，沒有領到，沒有辮子的東西似乎離娘並不在乎看到一回面。我料定這老爺的，裏面睡着的小生。我們魯鎮是僻靜地方。他摸出四角的時候，他的姓名就叫舉人老爺家裏，逐漸減少了一對，如小雞。', '2021-06-30 08:03:09', '2021-06-30 08:03:14'),
