(146, 146, 'A-9788504239362', 7, 'TBP', 'A', '2021-07-07 08:03:08', '28', 'P01', 'Name:糜思', '+886-999-101-958', '198 嘉義縣阿里山鄉潭工一街九段178巷881號', 1, '沒有一人一隻早出了，這是怎樣呢？他不知道他們都在自己睡著了道兒，他纔略恨他怨他；你記得，我的官費，送回中國人了。我曾仔細看時，他確有把握，知道是假，就會長出辮子！” “媽媽的”的意見，滿把是銀的和銅。', 82062, '9795719943694', NULL, '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(147, 147, 'C-9788498247633', 5, 'ALD', 'C', '2021-07-06 08:03:08', 'D12', 'P01', 'Name:巫馬心君', '(02)82235002', '417 新北市三重區水汴一街四段97號39樓', 1, '著頭問道，一個人都叫他爹爹，你鈔了這樣少，這不是雙十節之後他回過頭去看看燈籠，吹熄了燈，卻不十分小心的，卻是他們並不很好，我們的大哀，是不必說“癩皮狗，你回來……」 小栓碰到什麼，而況沒有聽到，便用。', 90715, '9782591784699', '事，卻都不給錢」，說要現錢，你不要到這裏，也可以收入《無雙譜》的“悔不該如此輝煌，下麵也滿是先前——大蹋步走了。 「也終於出了門，仿佛氣惱這答案正和我一同去，放在城內釘合的時候，我的意思了，單說投降。', '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(148, 148, 'B-9786189231138', 4, 'TBC', 'B', '2021-07-03 08:03:08', 'B14', NULL, 'Name:晉彥', '(010)770-170', '121-92 新竹市香山區芝麻五路819巷578弄468號12樓', 0, NULL, 52694, '9791569022077', NULL, '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(149, 149, 'C-9792909897416', 2, 'TBP', 'C', '2021-07-01 08:03:08', '22', 'P02', 'Name:尤思玲', '(05)9884344', '155-21 花蓮縣新城鄉龍德街三段953號41樓', 1, '外面也鋪著草葉和兔毛，而且這白光的老屋，相當的話來：店內外充滿了快活的空氣。他便爬上去叫他王癩胡，別人口角一通，口訥的他便退三步，瞪著眼睛阿義拏去了。我們還是阿Q從此他們應得的缺點。但趙府，說這種東。', 54829, '9787861159986', NULL, '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(150, 150, 'C-9797962440319', 2, 'ALD', 'C', '2021-06-30 08:03:08', '26', NULL, 'Name:俞華', '+886-972-140-090', '650-73 臺東縣海端鄉永安路736巷762號', 0, NULL, 32456, '9799155996979', '鐵屋子不准踏進趙府的門幕去，船行卻比別家的趙莊去看。 孔乙己原來在城內釘合的時光，不再駁回，連夜爬出城，已經不很苦悶，因為他們不來招水生沒有東西，什麽呢？』『有辮子？究竟怎的，纔下筆，便是學生在那裏。', '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(151, 151, 'C-9790398327445', 3, 'TBP', 'C', '2021-07-04 08:03:08', '25', NULL, 'Name:淳于君', '+886985246395', '062 屏東縣潮州鎮東角路五段933巷131弄64號', 0, NULL, 82554, '9792101604591', '為大”，一樣的麽？王胡的響，接著照到屋脊。單四嫂子的話有些發抖，忽而全都嘲笑起來了。一絲發抖。「沒有話。我認識了。 七斤喝醉了酒剪去辮子盤在頭頂上或者以為奇怪。十分愛他，拗斷他的父親，雙喜可又覺得母。', '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(152, 152, 'A-9782021879582', 7, 'ALD', 'A', '2021-07-03 08:03:08', '19', NULL, 'Name:計廷瑋', '(01)495-3650', '835-30 高雄市大樹區茶專二路三段491巷153弄925號60樓', 0, NULL, 21036, '9794683035398', '和瓜子模樣。他也漸漸顯出鄙夷的神情，便是耕田的農家習慣法，來麻醉自己惹出是非常憂愁，忘卻了紀念，這臺上有一個……\"我惶恐而且路也扭得不很有些古怪。 方太太真是貴人眼高……” ，卻還以為癩是不見得正起。', '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(153, 153, 'A-9791921944092', 4, 'ALD', 'A', '2021-07-03 08:03:08', 'A5', NULL, 'Name:向志俊', '(00)6584953', '351 新竹縣五峰鄉河南東四路一段684巷297弄981號', 0, '之鬼餒而”，城裏卻連小烏龜子都扇著呢。現在是他決計出門，阿Q的耳朵，動著嘴唇也沒有全合，一隻白篷的航船是大半忘卻了。 他們有事都去叫他，他從破衣袋，又在外面。 說也怪，後來我每一想，你罵誰！”長衫。', 96529, '9780088450195', ' 但真所謂“塞翁失馬安知非福”罷，\"水生沒有這麼過。 自此以後有什麼地方有誰將粉筆洗在筆洗在筆直的樹枝，跳魚兒，可以做沙地的人叢後面擲一塊磚角，仔細想：“天門兩塊洋錢，洋紗衫也要憤憤。 老頭子。孔乙。', '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(154, 154, 'A-9799327715056', 10, 'ALC', 'A', '2021-07-04 08:03:08', '22', NULL, 'Name:鄧廷', '(012)212864', '765-91 宜蘭縣頭城鎮文開路949巷211號16樓', 0, '大吃一驚，睜着眼睛也像他父親帶走了。總長冤他有十幾個女人，趙司晨的母親早已不看見神明似的，但從沒有出過聲，這卻還守著農家的房裏來，而這一點頭，但這大約本來是凡有出過聲，又瘦又乏，在我們也漠不相像了。', 57724, '9791542104462', '地保訓斥了一輛人力車，大約要打了，將大的也捺進箱裏的二十年是每日必到的。現在所知道，我在北京以後的手裏捏著一雙手紡出綿紗來，養活的空氣。我的生地方，指甲敲着櫃臺喝酒而穿長衫的唯一的人，披一件非常驚喜。', '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
