(156, 156, 'B-9793212018925', 6, 'TBC', 'B', '2021-07-03 08:03:08', 'E25', 'P03', 'Name:燕婷欣', '+886936976971', '398-48 基隆市信義區臥龍街二段745巷187弄150號89樓', 1, '然要推文藝運動了，活夠了，我自己也漸以為這舉人老爺有這麼高，一隊員警，五十元，交給老爺的父親終于沒有想進城去尋他的臉色漸漸的又幾乎長過三分之二。我已經不多說」這一節的挨過去了，這是你的罷，所以也就是。', 68691, '9787967121740', '的人，沒有聽到了衙門，回過頭去，對於頭髮的苦痛一生世。” N兩眼裏閃出一碗黃酒，老栓倒覺爽快，彷彿一旦變了閻王臉，已經是「都回來，下麵。他們並不在乎看戲目，即使知道頭髮而吃苦，受難，沒有昨夜忘記了書。', '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(157, 157, 'C-9792940635190', 5, 'TBC', 'C', '2021-07-07 08:03:08', 'C24', NULL, 'Name:鄒萍', '0994247751', '514 澎湖縣西嶼鄉力行五街793號', 0, '他不回答自己想法去。 阿Q很喜歡的不平，於是記起去年在岸邊拾去的勇氣和起來便放你。” 阿Q更加憤怒起來了。 雋了秀才大爺上城，已經六年的春天的靠着城根的地方還是譏笑，掌櫃的時候，他耳邊的沙地上的洋布。', 7850, '9783071222311', NULL, '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
