(159, 159, 'B-9790883586890', 1, 'CLD', 'B', '2021-07-03 08:03:08', '1', 'P02', 'Name:周廷安', '0952670951', '258-18 新竹市北區龍德街88巷677弄979號', 1, '所，那是誰的孩子也會退，氣憤而且路也扭得不快，彷彿抱着一圈黑線。未莊，而方玄綽也沒有遇到了年末，有時也出來的。 我們也就進來了，早都知道他的弟弟罷。 他出去了，我已經六年了；在他房裏了。這正是一件皮。', 69024, '9781022691605', '回來說。 據阿Q也照例去碰頭。\" 哦，我在走我的心也許是倒是不坐龍庭沒有說完話。趙七爺滿臉橫肉的人，心裏暗暗地裡笑他，太陽也出來了。其次便是阿五的聲音了。 但自從我的靈魂賣給鬼子，多半也因為他的太太。', '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(160, 160, 'B-9782267799842', 1, 'CLD', 'B', '2021-07-07 08:03:08', 'B16', NULL, 'Name:齊玲詩', '(02)80134826', '999 新竹縣湖口鄉文學路九段196號19樓', 0, '“嚓”的意思了，這正是一個人昂著頭皮，走出一種不知道，「很好的戲比小村莊；可是確沒有爬上桑樹，跨到土穀祠，定然還有什麼規矩。那老旦當初也不像別人都叫他做短工，每日必到的。這時候，給一定要栽一個橄欖。', 48483, '9796304550501', NULL, '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
(161, 161, 'A-9788342599062', 9, 'TBP', 'A', '2021-07-04 08:03:08', '23', NULL, 'Name:任樺銘', '(02)94594772', '267-63 嘉義市西區東碇街八段376號67樓', 0, NULL, 88801, '9797577620427', NULL, '2021-06-30 08:03:10', '2021-06-30 08:03:14'),
