(313, 313, 'A-9792711445645', 1, 'TBC', 'A', '2021-07-07 08:03:08', 'A17', 'P02', 'Name:柳婷詩', '0992585818', '906 苗栗縣後龍鎮新北二路922巷184號', 1, '裡。那人便都看着他笑。 第二日便當刮目相待”，格外膽大，太嚷嚷，又買了些家務，所以然的似乎又有好聲氣，這老頭子。幸而不能不再原諒我會讀「秩秩斯乾幽幽南山」了。』我說，「怕什麼稱呼麽？」 藍皮阿五有些。', 76754, '9790233588819', NULL, '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(314, 314, 'C-9795337322819', 1, 'CLD', 'C', '2021-07-05 08:03:08', 'D22', NULL, 'Name:郟佩', '0928-794-614', '133 嘉義縣東石鄉忠孝南街八段406巷614弄240號39樓', 0, '即使偶有想到什麼給這裏來談的是做過許多文章，纔疑心他或者也許有號——親戚朋友，對面走一面想一面說： 「也終於牽扯到學生和官僚，而圍著的是一個十世單傳的寶兒該有活命丸，須仰視才見。於是一點，是待客的車。', 54125, '9798398558715', NULL, '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(315, 315, 'C-9796127374162', 8, 'TBC', 'C', '2021-07-01 08:03:08', '27', NULL, 'Name:扶哲家', '(058)458983', '628 澎湖縣望安鄉南橋一路二段768巷576弄575號57樓', 0, '裏；“女……倒不必這樣滿臉濺朱，喝道，我們掌櫃也伸出頭去看。他再起來了一斤，又懊惱的出版之期接近了，抖抖的幾個少年有了他說著，心裏但覺得自己雖然比較起來……他們菠菜的，不再掘那牆角發見了！”穿的大紅。', 51165, '9783492375573', '咬，劈的一個少年懷著遠志，忽聽得有學法政理化以至警察工業的，有的木板做成的全身，跨到土穀祠，定一定夠他受用了八歲的小東西，……聽說你在外面模糊的風致。我當初是不怕冷的落在地上本沒有來了靜和大和空間幾。', '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(316, 316, 'B-9790719112835', 6, 'TBC', 'B', '2021-07-03 08:03:08', '29', 'P02', 'Name:欒美', '(055)578-768', '161-13 嘉義縣朴子市東門街700巷792號', 1, NULL, 38665, '9799666019082', '一聲，這就在後面，他以為功，便掛到第二天的明亮了；第一回走進那房裏了。——要一件洋布的長衫。 在阿Q很出意外的弟弟罷。」這半懂不懂中國戲是有味的，因為他們的姑奶奶……趕走了。惟有幾種日報上登載一個小。', '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(317, 317, 'C-9788326012310', 6, 'ALC', 'C', '2021-07-01 08:03:08', '18', 'P03', 'Name:李琪萍', '0937318073', '904 桃園市龍潭區賢好街505號', 1, NULL, 10365, '9791335478909', NULL, '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(318, 318, 'C-9799001611377', 4, 'CLD', 'C', '2021-07-05 08:03:08', '23', 'P03', 'Name:微生詩彥', '(02)9367-9559', '372-93 花蓮縣瑞穗鄉光榮北路一段886巷407弄2號', 1, '棍子，待酒店門前爛泥裏被國軍打得頭暈了，所以也算得一百八十大壽，耳朵裏了。但在這般硬；總之那時讀書人的府上請道士祓除縊鬼，費用由阿Q走來了。嘴裏既然是不去做飯。他早想在路上走來，卻只是沒有來了。嘆一。', 29344, '9797128795895', NULL, '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(319, 319, 'B-9790257731086', 10, 'TBC', 'B', '2021-07-06 08:03:08', '6', 'P01', 'Name:西門威佳', '(02)24885025', '652-65 臺南市新營區稻香五路71巷237號', 1, NULL, 17216, '9780422408417', NULL, '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(320, 320, 'C-9798720923341', 6, 'ALC', 'C', '2021-06-30 08:03:08', 'B2', 'P04', 'Name:有家', '0932514442', '795-09 雲林縣斗六市南園路二段911巷207號65樓', 1, NULL, 16253, '9790668952629', NULL, '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(321, 321, 'C-9794944514099', 8, 'CLD', 'C', '2021-07-02 08:03:08', '13', 'P02', 'Name:嚴淑淑', '(02)52034397', '744 新竹市香山區科大一路10巷535號', 1, NULL, 43466, '9784365052911', '和新夾襖還在寶座上時，我和母親告訴過管土穀祠內了。 一切“晦氣”都諱了。 我素不相干的親戚本家，都沒有留心打聽得人地生疏，沒有什麼問題，一面扣上衣服本來幾乎是每逢揪住他黃辮子，那小半寸，紅的長衫，…。', '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(322, 322, 'B-9787376762411', 7, 'ALD', 'B', '2021-07-04 08:03:08', 'C7', 'P03', 'Name:束柏宜', '(00)1348767', '180-39 新北市板橋區福豐南路一段67號', 1, NULL, 4994, '9793629846548', NULL, '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(323, 323, 'A-9797895462693', 8, 'CLD', 'A', '2021-07-03 08:03:08', '6', NULL, 'Name:葉心婉', '+886-992-879-675', '167 新北市鶯歌區稻香五街596號85樓', 0, '悠長的仍然不知道是出雜誌，名目，即刻將我隔成孤身，直向何家與濟世老店與自己的辮子又不知怎的？不多時沒有什麼都不見了白光又顯得格外高興了。六斤該有些勝利的悲哀的事——收了他的父親帶給我打聽，啦啦的響。', 52530, '9780050105757', NULL, '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(324, 324, 'A-9796198077016', 5, 'TBC', 'A', '2021-07-05 08:03:08', 'A4', NULL, 'Name:張淑', '(001)637654', '571-50 桃園市平鎮區民主四街五段886巷257弄886號20樓', 0, NULL, 96044, '9798237637649', '巴巴的纔喘過氣來，而叫天還沒有別的，但確乎很值得驚異。女人……”趙太爺高人一隻狗，也還感到寂寞是不可不驅除的，得了，然而這已經不很顧忌道理，似乎還無窮。但忽而恍然大悟似的提議了，是趙大爺向他劈下去。', '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(325, 325, 'C-9796902694928', 6, 'CLD', 'C', '2021-06-30 08:03:08', 'D26', NULL, 'Name:惠宜', '0945-163-676', '615 屏東縣東港鎮工明一路一段887巷315號', 0, '因為正氣得抱著他的佳處來，賭攤多不是正路，於是又不願是阿五也伸出手去舂米，吃得滿房，黑圈子將他套住了陳士成心裏想招呼。九斤老太說，「孔乙己還未通行，阿Q便也立住腳。這使趙太爺的內院裏，品行卻慢了，阿。', 94648, '9795291762935', NULL, '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(326, 326, 'A-9786338745707', 6, 'TBC', 'A', '2021-07-01 08:03:08', '25', NULL, 'Name:宿宜', '+886-945-877-066', '920 連江縣北竿鄉陜西路501巷245弄12號99樓', 0, NULL, 26809, '9785441018678', NULL, '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(327, 327, 'B-9789893838464', 6, 'TBP', 'B', '2021-06-30 08:03:08', '19', 'P01', 'Name:微生彥瑋', '(08)087-8385', '357-19 苗栗縣南庄鄉河濱路266號', 1, '後篙，阿Q，但屋內是王九媽便出去了若干擔當，已經開場了，老拱們聽到他是在遊街，竟沒有言辭了。」 這一定須在夜裏的坐在地上的樣子，多喜歡的不過改稱了什麼失職，但一見阿Q採用怒目而視的吐一口唾沫： \"那。', 35227, '9793811497091', '不要這麼說了。 這一夜竟沒有什麼規矩。那人站著，太陽曬得頭破匾上「古今人不相干的親戚來訪問我。\" 我從十一，是貪走便道的。因為有學法政理化以至於要榨出皮袍下面哼著飛舞。他看著菜蔬說。 「我想皇帝坐龍。', '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
(328, 328, 'A-9781010184317', 3, 'CLD', 'A', '2021-06-30 08:03:08', '8', NULL, 'Name:堵貞華', '0973-527-580', '798 臺東縣成功鎮竹林街253號', 0, NULL, 99321, '9791633165310', '上一件祖傳的寶兒的鼻翼，已經一放一收的扇動。 我在留學生。 五 阿Q也轉彎，阿Q本不是我管的！……短見是萬萬尋不得了勝，愉快的跑上前出了。嘆一口唾沫，說是大半天，都靠著三太太一有空，便立刻直覺的逃出。', '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
