(396, 396, 'C-9791503524308', 7, 'ALD', 'C', '2021-07-02 08:03:08', '9', NULL, 'Name:龐美', '(002)597859', '463 臺東縣長濱鄉新成路九段520巷604弄583號81樓', 0, NULL, 32034, '9780497945275', '是什麼，只為他根據了他麽！” “然而他現在，遠不如及早關了門檻坐着許多工夫。阿Q愈覺得站不住的前一閃爍，便在靠東牆的一個早已做過生日徵文的書，弔着打。阿Q的意思卻也希望降下一員天將，助他一定要栽一個。', '2021-06-30 08:03:11', '2021-06-30 08:03:14'),
