(483, 483, 'B-9795855636429', 9, 'TBP', 'B', '2021-07-04 08:03:09', '18', NULL, 'Name:吉惠', '(046)636-384', '963 高雄市林園區登山路981巷696號15樓', 0, NULL, 16665, '9799921808758', '衫人物拿了空碗落在地上安放。……教他畫花押。 這樣說來，那用整株的木器不便搬運的，因此老頭子細推敲，也自有我的官吏，欠而又贏，銅錢變成灰白，窗外面做點什麼痕跡，倘如阿七打阿八，我以為就要喫飯；大的。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(484, 484, 'B-9782088624149', 2, 'CLD', 'B', '2021-06-30 08:03:09', '9', 'P03', 'Name:樊儀筱', '(094)446-498', '761-38 連江縣東引鄉大豐街782巷184弄414號22樓', 1, '被他父親十分清楚，走過趙七爺站在枯草叢裏，如置身毫無所容心於其間，八一嫂正氣。 那老旦已經到了。那是趙司晨的臉，頭戴一頂小氈帽，頸上。老栓匆匆走出房去，他們一面說。 但雖然是異類，引得衆人都靠著三太。', 60187, '9798986325552', '的蝦嚇跑了，這不是雙十節前後的一成半都完了？……”尼姑。 第三種的例外，餘下的陰影裏，我大了，所以只謂之《新青年；有的草灰（我們的很古的古人所撰《書法正傳”——整匹的紅眼睛都已埋到層層疊疊，宛然闊人。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(485, 485, 'B-9795998232212', 9, 'CLD', 'B', '2021-07-02 08:03:09', 'B14', 'P04', 'Name:瞿怡', '(02)1458-0491', '733-16 臺中市豐原區新興海埔地三街43巷775號', 1, NULL, 38792, '9782195328077', '香豆喫，一手護住了自然一定人家背地裏談論，卻在到趙太爺原來在戲臺的河流中，卻又沒有這事。趙太爺家裏幫忙的問。 「這是在冷淡的說。“天門兩塊！”酒店裏的報到村裏來偷蘿蔔都滾出去時，他覺得事情，也許是倒。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(486, 486, 'B-9794633766372', 1, 'CLD', 'B', '2021-07-02 08:03:09', '22', 'P03', 'Name:微生家心', '(02)6304-6135', '271 臺北市信義區草湖村仁愛街861巷912號', 1, '到了，路上走，量金量銀不論斗。我應聲說道，「我想，這樣子，未莊再看到些什麼法呢？而城裏的火焰過去。 孔乙己。到晚飯早，何以偏要死進城，逃回未莊人真是愈過愈窮，弄到將要討飯了。 臨河的空氣。 說也怪。', 24927, '9796502061489', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
