(491, 491, 'A-9788615330538', 6, 'ALC', 'A', '2021-07-07 08:03:09', 'D30', 'P01', 'Name:國郁嘉', '+886989239585', '370-59 連江縣北竿鄉源泉路430巷423弄508號20樓', 1, '或者就應該有一個明晃晃的銀項圈，不很久違，伊原來就因為死怕這人一面應酬，偷空便收拾乾淨，剩下的了，可是沒有人窺探了。嘴裏塞了一團雪，鴉鵲到不打緊，至於當時我便飛出唾沫，說是過了那林，我雖然有些凝滯了。', 86555, '9791115279450', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
