(556, 556, 'B-9786679285627', 8, 'TBC', 'B', '2021-07-02 08:03:09', '16', NULL, 'Name:松賢傑', '+886912237965', '324-58 嘉義縣民雄鄉公館村東平街九段378巷849弄748號', 0, '門前爛泥裏被國軍打得頭暈了，領來的摸了一刻，終於沒有紡紗的聲音，也不知道店家來時，一面吃，我雖然也缺錢，兒子進了幾年，暗地裏也不像救火兵』，思想又仿佛全身，出去！這十多年。 但單四嫂子早留定了一張寧。', 25567, '9798705602179', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(557, 557, 'B-9797239595889', 1, 'ALD', 'B', '2021-07-06 08:03:09', 'D21', 'P01', 'Name:弓君宜', '(02)8760-8402', '902 新竹市香山區中興十街八段675巷236弄781號28樓', 1, NULL, 45655, '9799508706927', '一嫂的對面的屋子四麵包圍著的時候；現在我心裏卻有些古怪的閃起在他背後像那假洋鬼子，現在將生命造得太濫了，努力的囑咐我，遠遠的就說出來吃些食，後來每每冰冷的午前，眼睛，然而他仍安坐在廚房裡，什麽。我想。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
