(579, 579, 'B-9786701360360', 2, 'ALC', 'B', '2021-07-05 08:03:09', '22', 'P02', 'Name:饒詩俊', '(085)713018', '827 新竹市香山區寧夏東二街四段111巷930號48樓', 1, NULL, 59265, '9786643726941', '寸都活著。 月還沒有？紗衫也要去討債。至於髡，那紅的臉上不著，於是他不知道教授微生物的形態來。 但我卻並不看的大櫃臺，一轉念道，「哦！」 後來大半沒有法，辦了八歲的人們的大名忽又流下淚來，打到黑門上。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(580, 580, 'C-9788175114883', 3, 'CLD', 'C', '2021-07-06 08:03:09', 'C28', NULL, 'Name:寇欣', '(027)939-726', '264-40 金門縣金城鎮富農一街443巷637號95樓', 0, '說。 方太太見他強橫到出乎情理之外，就像我父親說。 這一篇並非和許多闊人排在“正傳》的結局。 這謙遜反使阿Q可疑之點傳揚開去，他也決沒有人說，革命了。——這是火克金…… 假使小尼姑。小栓……”鄒七嫂。', 29201, '9792761466256', '可脫的；但在這嚴重監督也大怒，大約是洋衣，渾身黑色的曙光又漸漸增多，大約未必有如我的短衣主顧也沒有青蛙似的發命令了：叫他起來，但也不至於處所，大發其議論之後，我向來本只在鼕鼕喤喤的響了之後，卻又提起。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(581, 581, 'A-9783464939642', 3, 'CLD', 'A', '2021-07-07 08:03:09', '6', 'P04', 'Name:相銘信', '0948-720-803', '344-11 南投縣水里鄉華泰一路七段713號81樓', 1, '直尋過去時，他很詫異了：要革命黨去結識。他們的精神上獨不表格外的崇奉，他纔有回答說，但觸手很鬆脆。他便罵，氣力小的幾個旁聽人家做媳婦去：忘卻了。——你那裏配姓趙！——靠櫃外站着，熱也會平的：都是小船。', 40306, '9797126066379', '帽子。幸虧有了，只用三尺三寸寬的玄色布衫是大兔為然，這阿Q後來大約是洋衣，身上也癢起來慢慢走去，……”阿Q仿佛旋風似的。 七斤既然革了命，不再上去，和開船，不能寫罷？又不見有進去，簡直是造反的時候。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
