(608, 608, 'B-9781709179600', 6, 'TBC', 'B', '2021-07-06 08:03:09', '1', NULL, 'Name:關哲庭', '0999218613', '634-53 嘉義縣水上鄉崇陽街八段428巷381弄891號', 0, '話，咳着睡了；我就知道談些閑天，掏出十多歲，「誰要你的墳，一個人詫異，忙了，單說投降，是一件徼幸雖使我的蝦嚇跑了六十多天，掏出每天總在茶館裏，也就不再上前，卻是一匹的紅眼睛，又親看將近初冬的太牢一般。', 59238, '9799396180861', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(609, 609, 'A-9792490731199', 1, 'TBC', 'A', '2021-07-06 08:03:09', '17', NULL, 'Name:宋怡', '(092)032-685', '454-83 臺中市南區長樂五路五段901號', 0, '醺的在酒店門口，站在老栓只是有見識，阿Q是問。在這一晚打劫趙家遭搶了！」他於是說： “我是性急的節根，一個難關。他們仍舊只是廣大，所以我們還沒有話，怎麼一來，於是只得擠在遠處的本家。 天氣沒有留用的。', 64045, '9788527365765', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(610, 610, 'B-9791530251109', 1, 'TBC', 'B', '2021-07-02 08:03:09', 'B5', 'P01', 'Name:宰父佳君', '(070)510-839', '695-04 宜蘭縣三星鄉香賓街得月巷街80巷228號49樓', 1, '醫學專門學校裏又聽得打門聲音。我雖不敢走近身，自己也漸漸的高興，燭火像元夜似的在腦裏一顆彈丸要了兩個耳朵已經高不可收，每名二百文酒錢，學校的講堂中，卻看到，都給你。” “打蟲豸，好容易才雇定了一對。', 81192, '9788265116995', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(611, 611, 'C-9792396720143', 6, 'ALC', 'C', '2021-07-05 08:03:09', 'A18', NULL, 'Name:糜嘉柏', '+886-935-921-371', '537 宜蘭縣大同鄉濟南街721號', 0, '以慰藉那在寂靜，然而我並不然。要什麼，過了三句話，幾個掘過的舊痕跡也沒法，想些計畫，但伊的破屋裏散滿了快活，也未免也有以為可以送他到了風聲了麽？” 於是各人便又飄飄然的走路也愈走愈大，伊歷來本只在過。', 6383, '9786833740061', '目而視的說道：「辮子，將我擬為殺頭。 “在這一句戲。現在卻忽地模糊的風致。我說： “革命也好罷。加以午間喝了酒，老栓看看。 三太太怕失了笑。然而阿Q不獨是姓趙麽？況且未莊賽神的挖起那東西也真不像……。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(612, 612, 'B-9790323091250', 8, 'ALD', 'B', '2021-07-01 08:03:09', 'E1', 'P04', 'Name:蕭賢俊', '+886929468531', '033-24 高雄市旗津區彰濱東七路8巷281號', 1, '的好。我說， 「誰要你來多嘴！你又來了。 沒有了十分得意的騙子，正在專心走路，是女人的叢塚。兩人離開了。 脫下衣服都很破爛的便都看見，小Don。這時突然仰面看那烏鴉喜鵲想要連珠一般；常常嘆息說，他也。', 4406, '9782025919000', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(613, 613, 'B-9781901861594', 1, 'CLD', 'B', '2021-07-02 08:03:09', 'E10', NULL, 'Name:柳君淑', '0905-503-578', '442-21 連江縣南竿鄉縣政六街二段316巷179號21樓', 0, '夷的神氣，便從不入三教九流的小東西，也便小覷了他的——或者也許放慢了腳步的向前走，不如一代不如一片海，便叫他閏土說。 老栓候他平日喜歡的玩意兒了？這活死屍的囚徒……” “呵！」我回去了！\"一種異樣。', 51693, '9783932438523', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(614, 614, 'C-9782881456053', 4, 'ALC', 'C', '2021-07-04 08:03:09', '25', 'P03', 'Name:隗安', '(01)121-4112', '862-16 澎湖縣望安鄉龍鳳路一段512巷556號3樓', 1, '了我的心忽而大的聚在船頭的情誼，況且未莊人真可惡的是張大帥就是六一公公送給母親也很不少，也覺得要和革命黨也不細心，許多日，鄒七嫂又和趙太太料想便是與眾不同的。所以宮刑和幽閉也是半白頭髮，衣服摔在地之。', 44272, '9794183223912', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(615, 615, 'A-9792632060156', 10, 'TBP', 'A', '2021-07-01 08:03:09', 'A6', 'P03', 'Name:解安傑', '+886-991-875-689', '939-32 雲林縣水林鄉遼北路13巷622號', 1, NULL, 64184, '9798532432369', '而空了。而且知道無話可說了一刻，終於出臺是遲的，但也不相能，回到相隔二千餘里，藍皮阿五說些話；第二天便將大不安于心，阿Q赤著膊捉蝨子，有時也遇不見有甕口，默默的吃飯之後，捧著一把抓住了筆，在我們後進。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(616, 616, 'A-9789906438193', 2, 'ALD', 'A', '2021-07-04 08:03:09', '3', 'P02', 'Name:包詩芬', '(09)447-1028', '293-01 高雄市阿蓮區名山六路806號4樓', 1, NULL, 43027, '9791900413274', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(617, 617, 'C-9789932984893', 6, 'CLD', 'C', '2021-07-01 08:03:09', 'B30', 'P01', 'Name:井庭冠', '(00)600-3899', '722 彰化縣秀水鄉五權西路873巷19號', 1, NULL, 67267, '9798807418913', '木須得上城，傍晚又回到土穀祠去。 阿Q萬料不到他也仍然沒有見。而這一節。然而我的麻子阿四病了的糖塔一般靜。我們上船的時候，不肯瞞人的家眷固然是深冬；我疑心他或者是春賽，是促其奮鬭的，因爲上面所說的。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(618, 618, 'A-9790286983661', 1, 'ALD', 'A', '2021-07-05 08:03:09', 'C3', NULL, 'Name:濮婷惠', '0920-443-444', '746 基隆市七堵區錫安街176巷219號', 0, '的敲了一會，連忙吞吞吐吐的說笑聲裏走出前艙去生火，屋子便接了，前天伊在灰堆裡，一面吃，然而情形，在簷下，夾襖的阿Q萬料不到什麼。——我都嘆息他的旁邊，伸手去摸胸口，不要命，不知道的。 “沒有問題，一。', 74943, '9797331040959', '土穀祠，定下發掘的勇氣開口說，「孔乙己到廚下炒飯吃去。他急忙迴轉船頭的罪。 “我想，不久都要錢，照例的幫人撐著仍然去釣蝦。 有幾位辮子，要不是也心滿意足的得勝利者，總是鈍重的不得。 最惹眼的這一氣。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(619, 619, 'A-9791067533679', 4, 'ALC', 'A', '2021-06-30 08:03:09', 'B13', 'P03', 'Name:柳瑋宗', '+886911345295', '697 新竹縣湖口鄉芳樂街八段289巷449號', 1, NULL, 7576, '9786567324872', '流滿面的情形。早晨，七十九歲了。只剩下不名一錢的支票是領來的命運之類，門口，卻全忘卻了王胡似乎叫他，往往不恤用了八公公的田裡又各偷了人聲，覺得有人進來了，又沒有動。 老拱挨了打，看見神明似的被官兵殺。', '2021-06-30 08:03:12', '2021-06-30 08:03:14');
