(627, 627, 'C-9790653881309', 6, 'ALC', 'C', '2021-07-01 08:03:09', 'C20', 'P04', 'Name:公羊鈺', '0944794376', '150-66 新北市平溪區永安街一段801巷243弄617號28樓', 1, NULL, 25672, '9781438628219', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(628, 628, 'A-9795550892083', 10, 'TBC', 'A', '2021-07-06 08:03:09', '28', NULL, 'Name:易伶婉', '0951-840-982', '527 金門縣烈嶼鄉南勢坑路二段808號', 0, NULL, 21094, '9792144465692', '晚上商量之後，我和母親倒也並不很顧忌道理。其次就賣了豆，瞪着；便忍不住要問，仍然有點特別，女人，女人，也有將一尺來長的辮子了……\"他多年，竟將我擬為殺頭的老屋，相傳是往來的消息，突然大悟似的在腦裏了。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
