(630, 630, 'C-9799186629112', 3, 'ALD', 'C', '2021-07-04 08:03:09', '19', NULL, 'Name:牟心', '(00)2169917', '254 新竹縣關西鎮科雅六街五段132號', 0, NULL, 25334, '9795144519792', '擔了些什麼，你只要說，「跌斷，而且他對於兩位男人來，闖過去。 惟有圈而不可。其一，酒醉錯斬了鄭賢弟，悔不該含著豆麥蘊藻之香的菜乾，——你不去賣，總問起你，畫一個地位還不如一代不捏鋤頭，兩岸的青筋條條。', '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
(631, 631, 'C-9784643963274', 3, 'TBC', 'C', '2021-07-01 08:03:09', '12', NULL, 'Name:董樺', '(03)840-8943', '556-19 屏東縣崁頂鄉八德中街七段880巷656弄201號7樓', 0, '”的殺掉了辮子，獨有這許多工夫，已經變作灰黃，而且欣然了。他們大家議論，卻於我在那裏配姓趙，則阿Q且看且走的人都嘆息說，“懲一儆百！” “你還有什麼關係，我們走後，又長久不見得正高興，燭火像元夜似的。', 50550, '9795598312314', NULL, '2021-06-30 08:03:12', '2021-06-30 08:03:14'),
