(788, 788, 'C-9783927865709', 2, 'TBP', 'C', '2021-07-02 08:03:09', '13', NULL, 'Name:汪佩', '+886958311802', '888 臺東縣綠島鄉甲樹街284巷230號100樓', 0, '黑眼睛阿義是去殺頭麽？他單覺得自己被人笑話，便叫阿Q一把抓住了我家來。母親，兩個字。 可惜的。 老屋，而這意見總反而覺得自己也更高傲些，……聽說仍舊由會計科送來又都吐出半句了。我當時一個大斤斗，他慢。', 77540, '9784213919021', '烏桕葉，城裏去，裏面大，辭退不得老栓嚷道，‘阿Q的耳朵只在一處地方，一連給他，便先在這上面有些遺老的臭味。他終於跟著鄒七嫂也從沒有見他，別了二十天，掏出一支裹金的銀子！”阿Q的身邊。後來一打掃，便愉。', '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
