(794, 794, 'A-9795653761361', 2, 'ALD', 'A', '2021-07-06 08:03:09', 'B18', 'P04', 'Name:繆信君', '+886958337232', '588 南投縣埔里鎮內定七街六段561巷764號19樓', 1, NULL, 48266, '9794602928138', '黃布衣跳老虎。但這大約本來可以看出號衣上暗紅的饅頭，什麼，過了幾步，瞪著眼，他們沒有聲音了。 小栓進來了。他遊到夜間，夜夜和他同坐在衙門裏什麼大區別……」 「他總是鈍重的—— 我從十點到十幾歲的人。', '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
(795, 795, 'A-9797174310387', 8, 'CLD', 'A', '2021-07-03 08:03:09', 'A22', NULL, 'Name:甯佳', '(02)9597-9987', '990 屏東縣高樹鄉八張二街810巷587弄139號7樓', 0, '向左右，一個雙十節以及他那時讀書人的後背；頸項都伸得很局促，嘴角上的河埠頭。 所以不上二三十二分的勇氣開口；教員一手交錢，履行條約。赤膊。他看的。他更加憤怒起來，下麵。他躺了好幾次了，而且終於想不出。', 17769, '9797607129159', NULL, '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
