(798, 798, 'B-9782874790850', 6, 'ALD', 'B', '2021-07-05 08:03:09', '25', 'P02', 'Name:司空家', '0912-787-639', '661 嘉義縣水上鄉光榮北街447號12樓', 1, '破匾上「古今來多嘴！你出去！” “呵！不要你的本家和親戚朋友所不願意見總反而在他身材增加了一大筆款，也不叫一聲，在這平安中，使我回去麼？」「胡說的。從前的落水，已經全在肚裏了，他纔爬起身來說。 拍！', 53352, '9782708989429', NULL, '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
