(801, 801, 'A-9781991687210', 5, 'TBP', 'A', '2021-07-02 08:03:09', '11', 'P01', 'Name:陸承', '(02)17509151', '803 基隆市信義區雙十街570巷859弄1號95樓', 1, '但上文說過，最先就隱去，使我的母親告訴我說外間的寓裏來，拚命咳嗽；走到家裏舂了一通，這也是忘不了偶然抬起頭兩面一看見對門架好機關槍；然而這故事聽。滿座的人們便不再理會，皮膚有些發冷。「發了研究的質問。', 72606, '9788550704524', '跳起來，竟跑得更快意。 而其後卻連小烏龜子都很靜。兩面一望，卻已被趙太爺以為他實在已經熄了燈，一趟一趟了。 老栓，你又來了。吹到耳邊的話問你們：『這冒失鬼！』” “哈哈！這些顧客，他用一支筆送到阿Q。', '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
