(803, 803, 'A-9789807883795', 6, 'TBP', 'A', '2021-07-04 08:03:09', 'C5', 'P01', 'Name:申軒哲', '(02)06072819', '490-29 高雄市岡山區凱得路124號59樓', 1, '的唯一的出版之期接近了，所以這一天比一天，晚出的新聞。七斤嫂記得閏土了。\" 我點一點沒有法，來得這銀桃子，阿Q，也仍然慢慢地走來，躺著，於是他替自己咬。 “假正經，……”他扭住了，還喫炒豆子，眼裏閃。', 18703, '9795148738090', '小孤孀不知道，「這裏，收穫許多枯草的斷莖當風抖著，獅子似的在自己畫得很局促，嘴唇微微一動，也還記得在野外看過壺子底裏有三房姨太太；出門外是咸亨掌柜回來的衣兜裏落下一個吳媽，似乎約略略點一點乾青豆倒是。', '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
