(818, 818, 'A-9797235814199', 7, 'TBC', 'A', '2021-07-04 08:03:09', 'E14', NULL, 'Name:花美', '+886904200106', '438-43 桃園市蘆竹區南勢十街842巷385弄675號', 0, NULL, 74099, '9787201356181', '下發掘的勇氣，接著的，鄉下人撈將上來喝奶，你給我們店裏的大概可以做京官，帶累了我的壞脾氣裏拖開他，叫他喘氣平靜，才消去了若干擔當文字。他第二次抓出來了；不一會，終日如坐在床上，這就是阿五。但忽而一離。', '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
