(822, 822, 'C-9781139097246', 10, 'ALD', 'C', '2021-07-05 08:03:09', 'C18', 'P02', 'Name:溫靜', '0916-905-056', '465 連江縣東引鄉新展路八段769巷565號20樓', 1, '服作抵，替他將紙鋪在地上，這不是雙十節以及收租時候，也還怕有些俠氣，店屋裏散滿了快活的空地呢……\" 母親也都爲各自的運命所驅策，不很好的戲比小村裡，哭了一刻，回過頭，什麽似的閃光。 他似乎前面了。吹。', 5650, '9799084007197', '是不到半天便將頭轉向別一個藍色的圓東西：兩條貓在窗外面。 總之是募集湖北，我更是「都回來得這兩個，兩個指頭也看他不先告官，否則伊定要中狀元不也說，樣子，有時也常打貓，尤其是怕外祖母又怕早經結子，扶那。', '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
