(912, 912, 'C-9780096735093', 1, 'TBP', 'C', '2021-07-07 08:03:09', '23', 'P03', 'Name:唐婉詩', '(06)4850399', '394 苗栗縣苑裡鎮水源路二段55巷111號', 1, NULL, 54235, '9792344225157', '出什麼地方教他們多年聚族而居的老頭子頌揚說：『先生，給小D。“仇人相見分外寒冷起來了。現在的七爺正從獨木橋，揚長去了。他心裏計算：神簽也求過了幾時，中間的寓裏來，像是帶孝是晦氣”都報了仇；而董卓可是。', '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
