(914, 914, 'C-9794242269455', 7, 'TBC', 'C', '2021-07-03 08:03:09', 'C2', NULL, 'Name:強宗', '(02)8923-7208', '546 南投縣中寮鄉文莊街九段149巷466號', 0, NULL, 26328, '9781452667409', NULL, '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
