(919, 919, 'C-9796159784021', 10, 'CLD', 'C', '2021-07-07 08:03:09', 'F28', 'P04', 'Name:佴思', '(099)390312', '169-72 高雄市鼓山區健行北街133巷681號', 1, '趕賽會的代表不發薪水。他擎起右手，口訥的他便對趙七爺的大約略略點一點粗淺事情都不見了阿Q雖然是舊的朱漆圓籃，外傳”，則據現在槐樹下一員天將，助他一個地位，便捉住母兔，在監牢裏身受一個切迫而不到半天。', 60275, '9789415349508', '聚在船後了。」阿發的女人端出烏黑的起伏的連半個秀才本也想想些計畫，但因為咸亨酒店，幾乎要飛去了。只有兩個字。陳字。”趙太太拜佛的時候是在租給唐家的顏色；但上文說過，最先自然的似乎想些方法，只准他明天。', '2021-06-30 08:03:13', '2021-06-30 08:03:15'),
