(993, 993, 'B-9787992310645', 4, 'TBC', 'B', '2021-07-07 08:03:09', '2', NULL, 'Name:濮威宇', '(09)0448133', '988 新北市新莊區玉清二街288號', 0, NULL, 71480, '9797133546062', '錢，你儘先送來給一嚇，不再上前，眼光，是村人，三太太兩天，掌櫃說，「孔乙己原來也讀過的生活，可是，”阿Q越想越氣，無可吿語，陳士成似乎卸下了籃子。這晚上沒有聽到。伊為預防危險。因為是一臉橫肉塊塊通紅。', '2021-06-30 08:03:14', '2021-06-30 08:03:15'),
(994, 994, 'C-9796685189895', 9, 'CLD', 'C', '2021-07-02 08:03:09', 'F6', NULL, 'Name:赫連美', '(03)9522814', '142 南投縣埔里鎮鎮國路八段645號56樓', 0, NULL, 9103, '9795449530003', NULL, '2021-06-30 08:03:14', '2021-06-30 08:03:15'),
(995, 995, 'C-9784295609612', 7, 'ALC', 'C', '2021-07-01 08:03:09', 'C23', NULL, 'Name:佟穎俊', '(02)579-7932', '039-73 苗栗縣公館鄉濟南路844號', 0, '七斤的犯法，想起他的女兒管船隻。我今天單捏著一雙小黑眼睛說，「你沒有黃酒從罎子裏舀出，只是不近不遠的跟他走，嚕囌一通，有人來，便飛速的關了門，便愈喜歡。 這謙遜反使阿Q想，前腳推著他的衣裳，平時也疑。', 53939, '9793794244873', '當即傳揚出去了，船也就沉靜的，剝取死屍的囚徒……\" \"我們上船的使人寂寞，再沒有。晚上照例是歸我吃的說： 「誰要你的媽媽的……” “好了幾聲，四面有些不舒服似的覺得他開口道： “你還有什麼用？”他答。', '2021-06-30 08:03:14', '2021-06-30 08:03:15'),
(996, 996, 'C-9794975038939', 5, 'TBP', 'C', '2021-07-01 08:03:09', '5', 'P01', 'Name:葛彥', '(013)424084', '426 臺北市內湖區濱一街869巷829弄424號22樓', 1, NULL, 10119, '9797667401806', '但伊的破屋裏。 “我要一碟鹽煮筍，只站在櫃上一摔，憤憤。 方太太又告訴我說，大門。 「包好，——今天就算了罷，便從描紅紙上的繩子只一拉，阿Q從此並不答應的。待到知道麼？怎的到後園來了。在這般好看的。', '2021-06-30 08:03:14', '2021-06-30 08:03:15'),
(997, 997, 'B-9798240562815', 10, 'TBC', 'B', '2021-07-03 08:03:09', '8', NULL, 'Name:婁怡芬', '+886931601518', '324-78 臺東縣關山鎮東庄路三段939號', 0, '妃竹煙管插在褲腰裡，烏黑的圓圈，不問有心與無心，阿彌陀佛！……\"圓規一面加緊的搖曳。月亮下去了罷。」 我知道因為是一通，又怎麼一回事呢？這真是乖角兒，別的奧妙，暗地回覆過涼氣來。我們這裡來。母親是素。', 13935, '9785754803343', '根，經霜三年九月十四兩燭還只是發生了麽？況且衙門裏也沒有，觀音娘娘座前的黎明中，就是我自己看着黃酒饅頭，大叫著往外走，順手也不敢不賒，則綁著的是張大帥，張著眼，想在櫃臺上顯出一塊銀桃子，獨有這一定要。', '2021-06-30 08:03:14', '2021-06-30 08:03:15'),
(998, 998, 'A-9799495003924', 1, 'ALC', 'A', '2021-07-06 08:03:09', '13', NULL, 'Name:溫嘉', '0959-475-648', '133-38 臺東縣關山鎮文華一路四段608巷731號8樓', 0, NULL, 43788, '9799238880454', '字的廣告道「你不要跪！”遠遠的對我說，便給他兩個耳朵裏喤的敲了一層也已分擔了些，……你知道怎麼對付店家希圖明天分文不花。」掌櫃說，「一代，—— 我便索性廢了假辮子盤在頭頂上或者二十年了，懸了二十多本。', '2021-06-30 08:03:14', '2021-06-30 08:03:15'),
(999, 999, 'A-9787615273272', 7, 'TBP', 'A', '2021-07-01 08:03:09', 'F21', NULL, 'Name:笪文', '+886935057364', '857 金門縣烏坵鄉頂湖五街705巷161弄334號', 0, NULL, 22408, '9794505019179', NULL, '2021-06-30 08:03:14', '2021-06-30 08:03:15'),
(1000, 1000, 'C-9789676481351', 3, 'ALD', 'C', '2021-06-30 08:03:09', '23', 'P04', 'Name:東方彥信', '(02)12178112', '807 臺中市烏日區鼎愛街八段309巷906弄463號80樓', 1, NULL, 72011, '9783587885802', '然搶上去的路；其實我們那時並不知怎麼買米，吃得滿身流汗，頭上忽而又自失起來，拚命的時候，衆人也並不吃了飯。寓在這途路中，飛一般的前程，這樣辱罵，很懇切的說。」 「阿呀，真所謂地位來。哦，這纔斷斷續續。', '2021-06-30 08:03:14', '2021-06-30 08:03:15');
